import React from 'react'
import {render} from 'react-dom'
import App from './components/App'
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.min.css'; 

const Apple = () => {
  return (
    <div>
      <ToastContainer />
    </div>
  );
};

render(
    <App />,
    <Apple/>,
    document.getElementById('root')
)
